import React from "react";
import { NavLink, Link, withRouter } from "react-router-dom";
const Nav = () => {
    return (
       <header>
          <ul>
            <li>
                <Link to="/">Home</Link>
            </li>
            <li>
                <Link to="/counter">counter</Link>
            </li>
          </ul>
       </header>

    )
}
export default Nav;
